\/a>) \u0438 \u043a\u0438\u0442\u0430\u0439\u0441\u043a\u0438\u043c \u0433\u043e\u0440\u043e\u0434\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B0%D0%BD%D1%88%D0%B0\" title=\"\u0427\u0430\u043d\u0448\u0430\">\u0427\u0430\u043d\u0448\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a><ul><li>\u043d\u0430\u0446\u0438\u0441\u0442\u0430\u043c\u0438 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%82%D1%82%D0%BE_%D0%B2_%D0%90%D0%BD%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D0%B5_(%D0%91%D1%80%D0%B5%D1%81%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)\" title=\"\u0413\u0435\u0442\u0442\u043e \u0432 \u0410\u043d\u0442\u043e\u043f\u043e\u043b\u0435 (\u0411\u0440\u0435\u0441\u0442\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c)\">\u0410\u043d\u0442\u043e\u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0435 \u0433\u0435\u0442\u0442\u043e<\/a>.<\/li><li>\u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Heinkel_He_219_Uhu\" title=\"Heinkel He 219 Uhu\">\u041d\u0435-219<\/a>, \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0441\u0435\u0440\u0438\u0439\u043d\u043e \u0443\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u043b\u0438 \u043f\u043d\u0435\u0432\u043c\u043e\u043a\u0430\u0442\u0430\u043f\u0443\u043b\u044c\u0442\u0443.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1948_%D0%B3%D0%BE%D0%B4\" title=\"1948 \u0433\u043e\u0434\">1948<\/a>&#160;\u2014 \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a