0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Douglas_DC-8\" title=\"Douglas DC-8\">Douglas DC-8-Super 63CF<\/a> \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 Loftleidir HF (Icelandic Airlines) <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_DC-8_%D0%B2_%D0%9D%D0%B5%D0%B3%D0%BE%D0%BC%D0%B1%D0%BE\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 DC-8 \u0432 \u041d\u0435\u0433\u043e\u043c\u0431\u043e\">\u0432\u0440\u0435\u0437\u0430\u043b\u0441\u044f \u0432 \u043a\u043e\u043a\u043e\u0441\u043e\u0432\u044b\u0435 \u043f\u043b\u0430\u043d\u0442\u0430\u0446\u0438\u0438, \u043d\u0430\u0445\u043e\u0434\u044f\u0449\u0438\u0435\u0441\u044f \u043f\u0435\u0440\u0435\u0434 \u043f\u043e\u043b\u043e\u0441\u043e\u0439<\/a>. \u0418\u0437 262 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u043b\u0438 183.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1979_%D0%B3%D0%BE%D0%B4\" title=\"1979 \u0433\u043e\u0434\">1979<\/a><ul><li>\u041f\u043e\u0441\u043b\u0435 \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u0438\u044f \u0441\u0442\u0430\u0442\u044c\u0438 \u00ab\u0410\u0442\u043c\u043e\u0441\u0444\u0435\u0440\u0430 \u043f\u0440\u0435\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430\u00bb \u042d\u043d\u0434\u0440\u044e \u0411\u043e\u0439\u043b\u044f, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0433\u043e\u0432\u043e\u0440\u0438\u043b\u043e\u0441\u044c \u043e \u0442\u043e\u043c, \u0447\u0442\u043e \u043e\u0434\u043d\u043e \u0438\u0437 \u0432\u044b\u0441\u043e\u043a\u043e\u043f\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u043d\u044b\u0445 \u043b\u0438\u0446 \u0440\u0430\u0431\u043e\u0442\u0430\u043b\u043e \u043d\u0430 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0443\u044e \u0440\u0430\u0437\u0432\u0435\u0434\u043a\u0443, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%8D%D1%82%D1%87%D0%B5%D1%80,_%D0%9C%D0%B0%D1%80%D0%B3%D0%B0%D1%80%D0%B5%D1%82\" title=\"\u0422\u044d\u0442\u0447\u0435\u0440, \u041c\u0430\u0440\u0433\u0430\u0440\u0435\u0442\">\u041c\u0430\u0440\u0433\u0430\u0440\u0435\u0442 \u0422\u044d\u0442\u0447\u0435\u0440<\/a> \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u0438\u043c\u044f \u044d\u0442\u043e\u0433\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430&#160;\u2014 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BB%D0%B0%D0%BD%D1%82,_%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%B8_%D0%A4%D1%80%D0%B5%D0%B4%D0%B5%D1%80%D0%B8%D0%BA\" class=\"mw-redirect\" title=\"\u0411\u043b\u0430\u043d\u0442, \u0410\u043d\u0442\u043e\u043d\u0438 \u0424\u0440\u0435\u0434\u0435\u0440\u0438\u043a\">\u042d\u043d\u0442\u043e\u043d\u0438 \u0411\u043b\u0430\u043d\u0442<\/a>, \u0441\u043c\u043e\u0442\u0440\u0438\u0442\u0435\u043b\u044c \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u043a\u0430\u0440\u0442\u0438\u043d\u043d\u043e\u0439 \u0433\u0430\u043b\u0435\u0440\u0435\u0438 \u0438 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0439 \u0441\u043e\u0432\u0435\u0442\u043d\u0438\u043a \u043f\u043e \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0443. \u0412\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u0411\u043b\u0430\u043d\u0442 \u0431\u0443\u0434\u0435\u0442 \u043b\u0438\u0448\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%8B%D1%86%D0%B0%D1%80%D1%8C\" title=\"\u0420\u044b\u0446\u0430\u0440\u044c\">\u0440\u044b\u0446\u0430\u0440\u0441\u043a\u043e\u0433\u043e \u0437\u0432\u0430\u043d\u0438\u044f<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u